export default function TodoList(){
    const [todos, changeTodos] = React.useState('')
    useEffect(() => {
        fetch('/api/todo_list?format=json')
        .then(response => response.json())
        .then(data => {changeTodos(data)})
    }, [])
    return(
        <>
        <div className="registrationDiv">
            <p>Todo List</p>
            <p>{todos}</p>
        </div>          
        </>
    )
}
